import React, { useState } from 'react';
import { Link, Outlet } from 'react-router-dom';
import Banner from '../Components/Banner/Banner';

const Blogs = () => {

    const [blogs, setBlogs] = useState([
        {
            subject: 'abdelbasset babeler',
            discription: 'Lorem ipsum dolor sit amet consectetur adipisicing elit. Praesentium dicta minima et ipsum sapiente corporis aliquid aspernatur dolorum quaerat, perspiciatis consequatur velit, rem quisquam magni alias facere deserunt possimus repellendus',
            date: 'abdelbasset@gmail.com',
        },
        {
            subject: 'abdelbasset babeler',
            discription: '0658484674',
            date: 'abdelbasset@gmail.com',
        },
    ]);
    return (
        <div>

            <Banner
                pageTitle={'Blogs.'}
                subtitle={'Here is Some of my blogs that i have made '}
            />
            <br />
            <Link to={'displayBlogs'}>
                <button>Display Blogs </button>
            </Link>
            <Link to={'createBlogs'}>
                <button>Create Blogs </button>
            </Link>

            <Outlet context={[blogs, setBlogs]} />
        </div>
    );
}

export default Blogs;
